import React from 'react'
import styles from './contact.module.scss'

// JSX for contact us page.
const Contact = () => {

  return (
    <div className={styles.about}>
      <p className={styles.title}>Contact us</p>
      <p>Individuals interested in learning more about the Power PIONEER Dashboard are encouraged to contact Project Director Eric Cote at <a target="_blank" href="mailto:cote@poweredforpatients.org">cote@poweredforpatients.org</a>, or by calling 202-810-0125.</p>
    </div>
  )
}

export default Contact
